import {BluetoothEscposPrinter} from "react-native-bluetooth-escpos-printer";
import {formatDate} from "./formatDate";
import {formatCurrency} from "./formatCurrency";


const logo = '';

export const generateReceipt = async (transaction) => {
    await BluetoothEscposPrinter.printerAlign(BluetoothEscposPrinter.ALIGN.CENTER);
    await BluetoothEscposPrinter.printPic(logo, { width: 250, left: 54 });
    await BluetoothEscposPrinter.printerAlign(BluetoothEscposPrinter.ALIGN.LEFT);


    await BluetoothEscposPrinter.printColumn([9, 2, 21],
        [BluetoothEscposPrinter.ALIGN.LEFT, BluetoothEscposPrinter.ALIGN.CENTER ,BluetoothEscposPrinter.ALIGN.LEFT],
        ["Date", ':' , formatDate(transaction.created_at)],{fonttype: 1,});

    if (transaction.is_takeaway) {
        await BluetoothEscposPrinter.printColumn([9, 2, 21],
            [BluetoothEscposPrinter.ALIGN.LEFT, BluetoothEscposPrinter.ALIGN.CENTER ,BluetoothEscposPrinter.ALIGN.LEFT],
            ["Customer", ':' , transaction.customer_name],{fonttype: 1,});
    } else {
        await BluetoothEscposPrinter.printColumn([9, 2, 21],
            [BluetoothEscposPrinter.ALIGN.LEFT, BluetoothEscposPrinter.ALIGN.CENTER ,BluetoothEscposPrinter.ALIGN.LEFT],
            ["Table", ':' , transaction.table.name],{fonttype: 1,});
    }


    await BluetoothEscposPrinter.printColumn([9, 2, 21],
        [BluetoothEscposPrinter.ALIGN.LEFT, BluetoothEscposPrinter.ALIGN.CENTER ,BluetoothEscposPrinter.ALIGN.LEFT],
        ["Type", ':' , transaction.is_takeaway ? 'Takeaway' : 'Dine-in'],{fonttype: 1,});
    await BluetoothEscposPrinter.printColumn([9, 2, 21],
        [BluetoothEscposPrinter.ALIGN.LEFT, BluetoothEscposPrinter.ALIGN.CENTER ,BluetoothEscposPrinter.ALIGN.LEFT],
        ["Cashier", ':' , transaction.user.name],{fonttype: 1,});

    await  BluetoothEscposPrinter.printText("-------------------------------\n",{});

    // product map
    for (let i = 0; i < transaction.items.length; i++) {
        let item = transaction.items[i];
        await BluetoothEscposPrinter.printColumn([2, 15, 15],
            [BluetoothEscposPrinter.ALIGN.LEFT, BluetoothEscposPrinter.ALIGN.LEFT ,BluetoothEscposPrinter.ALIGN.RIGHT],
            [String(item.qty), item.product.name , String(formatCurrency(item.sub_total, false))],{fonttype: 1,});
    }

    await  BluetoothEscposPrinter.printText("-------------------------------\n",{});
    // end product map

    await BluetoothEscposPrinter.printColumn([16, 16],
        [BluetoothEscposPrinter.ALIGN.LEFT, BluetoothEscposPrinter.ALIGN.RIGHT],
        ["Total Payment", formatCurrency(transaction.total_price, false)],{fonttype: 1,});

    await BluetoothEscposPrinter.printColumn([16, 16],
        [BluetoothEscposPrinter.ALIGN.LEFT, BluetoothEscposPrinter.ALIGN.RIGHT],
        ["Amount Paid", formatCurrency(transaction.payment_amount, false)],{fonttype: 1,});

    await BluetoothEscposPrinter.printColumn([16, 16],
        [BluetoothEscposPrinter.ALIGN.LEFT, BluetoothEscposPrinter.ALIGN.RIGHT],
        ["Change", formatCurrency(transaction.change_amount, false)],{fonttype: 1,});

    await  BluetoothEscposPrinter.printText("===============================\n\n",{});

    await BluetoothEscposPrinter.printerAlign(BluetoothEscposPrinter.ALIGN.CENTER);
    await BluetoothEscposPrinter.printColumn(
        [32],
        [BluetoothEscposPrinter.ALIGN.CENTER],
        ['Jl. Arief Rahman Hakim No.35, Cigadung, Kec. Subang, Kabupaten Subang, Jawa Barat 41213.\n\n\n\n'],
        {},
    );
}
